import NavBar from "./components/NavBar/NavBar";
import Home from "./pages/home";
import FunFact from "./pages/FunFact";
import { Route, Switch, Redirect } from "react-router-dom";
function App() {
  return (
    <>
      <NavBar />
      <Route path="/" exact>
        <Redirect to="/home" />
      </Route>
      <Route path="/home" exact>
        <Home />
      </Route>
      <Switch>
        <Route path="/fun-fact">
          <FunFact />
        </Route>
      </Switch>
    </>
  );
}

export default App;
